import { Box, InputBase, TextField } from "@material-ui/core"
import CheckIcon from '@material-ui/icons/Check';

export default function EditTodo(){
    return(
        <Box>
            <div>
            <TextField
                style={{width:'80%'}}
                defaultValue='Todoo'
                label='Nhiệm vụ mới'
            />
            <CheckIcon color='secondary' disabled />
        </div>
        </Box>
    )
}
